import './App.css';
import axios from 'axios';
import { useState,useEffect } from 'react';

const api = axios.create({
  baseURL:`http://localhost:3000/users`
})



function App() {

  const [users,setusers] = useState([])

  async function createCourse(){
    let res = await api.post('/',{id:6,first_name:'sagar',last_name:'chhatbar',email:'sagar@gmail.com'})
    console.log(res);
  }

  async function getUsers(){
    useEffect(()=>{
      api.get('/').then(res =>{
        console.log(res.data);
        setusers(res.data);
      })
    },[])
  }



  return (
    <div className="App">

        <button onClick={createCourse}>create user</button>
        {users.map(user => <h2 key={user.id}>{user.first_name}</h2>)}
    </div>
  );
}

export default App;
